Индомалайская зона — биогеографический регион, к которому относятся Южная и Юго-Восточная Азия. Делится на Малайскую и Индийскую подобласти. Индомалайская зона была выделена Альфредом Уоллесом, она состоит из следующих подобластей: 
* Малайская подобласть; 
* Зондская подобласть; 
* Индийская и Индокитайская подобласти; 
* Филиппинская подобласть; 
* Целебесская подобласть; 
* Папуасская подобласть.

